import "./HomePage.css";
import { Link ,useNavigate} from "react-router-dom";
import { useAuth } from "./db/firebase";
import { useHistory } from "react-router-dom";

import { auth } from "../db/firebase";

function LandingFrameMessage(props) {
  const auth = useAuth();
  const history = useHistory();
  const user = (props.location && props.location.user) || {};
  console.log(user);
  return (
    <div className="Landing-Frame-Message">
      <div className="Landing-Title">
        <h1>
          Hello, <span></span>
          {user.displayName}
        </h1>
      </div>

      <div className="Landing-description">
        <img src={user.photoURL} alt="" />
        <button
          className="button signout"
          onClick={() => {
            auth.signOut().then(() => {
              console.log("Sign out succesful");
              history.push("/");
            })
            .catch((error) => console.error(error));
          }}
        >
          Sign out
        </button>
      </div>
      <br />
    </div>
  );
}

function LandingFrame(props) {
  return (
    <div
      className="Landing-Frame"
      style={{
        backgroundImage: "url('/images/landing-page-background.jpg')",
      }}
    >
      <LandingFrameMessage props={props}/>
    </div>
  );
}
function HomePage(props) {
  return (
    <div>
      <LandingFrame props={props}/>
      <br />
    </div>
  );
}
export default HomePage;
